import './App.css';
import Join from "./comoponent/Join/Join";

// const ENDPOINT='http://localhost:4500/';
// const socket=socketIO(ENDPOINT,{transports:['websocket']}); 


function App() {

  // socket.on("Connect",()=>{

  // })

  return (
    <div className="App">
    <Router>
      <Route path='/' component = {Join} ></Route>
      <Route path='/chat'></Route>
    </Router>
    </div>
  );
}

export default App;
